import './Category.css';

import { Container } from "react-bootstrap";

function Category(){
    return(
        <div>
            <Container fluid>
                <div className = "category">
                    <h1>Featured Categories</h1>
                </div>
            </Container>
        </div>
    )
}

export default Category
